import React, { useState, useEffect } from "react";

const Issues = () => {
  const [activeIssues, setActiveIssues] = useState([]);
  const [evaluationData, setEvaluationData] = useState(null);
  const [evaluationError, setEvaluationError] = useState(null);

  useEffect(() => {
    const fetchActiveIssues = async () => {
      try {
        const response = await fetch("http://127.0.0.1:5001/active-issues");
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        setActiveIssues(data);
      } catch (error) {
        console.error("Error fetching active issues:", error);
        // Handle error appropriately
      }
    };

    fetchActiveIssues();
    const interval = setInterval(fetchActiveIssues, 5000);
    return () => clearInterval(interval);
  }, []);

  useEffect(() => {
    const fetchEvaluationData = async () => {
      try {
        const response = await fetch("http://127.0.0.1:5001/model-evaluation");
        if (!response.ok) {
          const errorText = await response.text();
          console.error("HTTP error fetching evaluation:", response.status, errorText);
          throw new Error(`HTTP error! Status: ${response.status}, Body: ${errorText}`);
        }
        const data = await response.json();
        setEvaluationData(data);
        setEvaluationError(null);
      } catch (error) {
        console.error("Error fetching model evaluation:", error);
        setEvaluationError(error);
      }
    };

    fetchEvaluationData();
  }, []);

  return (
    <div className="issues-and-evaluation">
      <div className="card issues-card">
        <h2>ðŸ›‘ Active Issues</h2>
        {activeIssues.length === 0 ? (
          <p className="no-issues">âœ… No critical issues detected</p>
        ) : (
          <div className="table-container">
            <table className="issues-table">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Description</th>
                  <th>Severity</th>
                  <th>Timestamp</th>
                  <th>Status</th>
                </tr>
              </thead>
              <tbody>
                {activeIssues.map((issue) => (
                  <tr key={issue.id} className={`severity-${issue.severity.toLowerCase()}`}>
                    <td>{issue.id}</td>
                    <td>{issue.description}</td>
                    <td>{issue.severity}</td>
                    <td>{issue.timestamp}</td>
                    <td>{issue.status}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>

      <div className="card evaluation-card">
        <h2>ðŸ“Š Model Evaluation</h2>
        {evaluationError ? (
          <p className="error">Error loading evaluation data: {evaluationError.message}</p>
        ) : !evaluationData ? (
          <p>Loading model evaluation data...</p>
        ) : (
          <div>
            {evaluationData.classification_report && (
              <div>
                <h3>Classification Report</h3>
                <pre>{JSON.stringify(evaluationData.classification_report, null, 2)}</pre>
              </div>
            )}

            {evaluationData.confusion_matrix && evaluationData.classes && (
              <div>
                <h3>Confusion Matrix</h3>
                <div className="table-container">
                  <table className="evaluation-table">
                    <thead>
                      <tr>
                        <th></th>
                        {evaluationData.classes.map((c) => (
                          <th key={c}>Predicted {c}</th>
                        ))}
                      </tr>
                    </thead>
                    <tbody>
                      {evaluationData.classes.map((actualClass, index) => (
                        <tr key={actualClass}>
                          <th>Actual {actualClass}</th>
                          {evaluationData.confusion_matrix[index].map((count, i) => (
                            <td key={i}>{count}</td>
                          ))}
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default Issues;
